import { VFC } from 'react';
import { Helmet, HelmetProvider } from 'react-helmet-async';
import HomeImage from 'img/HomeBackgroundImage.jpg';
import styled from "styled-components";

const Home: VFC = () => {
    return (
        <HelmetProvider>
            <Helmet>
            <title>Home</title>
            </Helmet>
                    <StyledBackgroundImg src={HomeImage} alt='home'></StyledBackgroundImg>
        </HelmetProvider>
    )
}

const StyledBackgroundImg = styled.img`
position: relative;
width: 100%;
min-height: 100vh;
center / cover;
`

export default Home;
